(1, 7, 'BB Cream - CC Cream - Kem Nền - TFS', 'CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++', 'cc-cream-thefaceshop-aqua-uv-color-control-cream-spf50-pa', 'Xuất xứ: Thefaceshop - Korea.', '<p><a title="CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/CC-Cream-Thefaceshop-Aqua-UV-Color-Control-Cream-SPF50-PA--"><span style="font-size: small;"><strong>CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++</strong></span></a></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">Trọng Lượng: 20g</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">Sau th&agrave;nh c&ocirc;ng của </span><a title="Face It Aura Color Control Cream" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/CC-Cream-Aura-Color-Control-Cream-Thefaceshop"><strong style="font-family: arial, helvetica, sans-serif; font-size: small;">Face It Aura Color Control Cream</strong></a><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;"> ra mắt đầu năm nay, Thefaceshop vừa tung ra d&ograve;ng </span><a title="CC Cream Aqua" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/CC-Cream-Thefaceshop-Aqua-UV-Color-Control-Cream-SPF50-PA--"><strong style="font-family: arial, helvetica, sans-serif; font-size: small;">CC Cream Aqua</strong></a><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;mới tinh n&agrave;y với khả năng vượt bậc hơn:</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;+Chống nắng SPF 50+ hơn cả kem chống nắng hằng ng&agrave;y bảo vệ l&agrave;n da dưới nắng mặt trời.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;+Chống thấm nước gi&uacute;p giữ lớp trang điểm cả ng&agrave;y d&agrave;i.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;+Cơ chế l&agrave;m m&aacute;t mới gi&uacute;p giảm nhiệt cho da (giảm nhiệt bề mặt đến 2 độ C so với nhiệt độ cơ thể) th&iacute;ch hợp cho make up ban ng&agrave;y, thoải m&aacute;i ra nắng m&agrave; kh&ocirc;ng lo da bị bỏng r&aacute;t v&agrave; bị tia UV tấn c&ocirc;ng nữa.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;+Chức năng c&acirc;n chỉnh m&agrave;u da, cho lớp nền đều m&agrave;u v&agrave; n&acirc;ng t&ocirc;ng da s&aacute;ng hơn một c&aacute;ch tự nhi&ecirc;n. Chất kem khi đ&aacute;nh l&ecirc;n da sẽ tự động chuyển m&agrave;u ph&ugrave; hợp với da bạn, c&acirc;n bằng những v&ugrave;ng s&aacute;ng tối tr&ecirc;n da v&agrave; che phủ khuyết điểm.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;"><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">C&oacute; 2 tone m&agrave;u: 01 - m&agrave;u s&aacute;ng v&agrave; 02 - tự nhi&ecirc;n.</span></span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;"><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;"><img title="CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++ 1" src="/uploads/img_product_detail/CC-CreamThefaceshopAquaUVColorControlCreamSPF50%20%281%29.jpg" alt="CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++ 1" width="604" height="475" /></span></span></p>\r\n<p>&nbsp;</p>', '2014_02_25_20_38_03-shopmyphamhan-CC-Cream-Thefaceshop-Aqua-UV-Color-Control-Cream-SPF50-PA++.jpg', NULL, 410000, 'CCTFS02', 1, '0', 0, 0, '1', '1', '1', 1385538227),
(2, 7, 'BB Cream - CC Cream - Kem Nền - TFS', 'BB Cream Magic Cover SPF37 PA++ ', 'BB-Cream-Magic-Cover-SPF37-PA---', 'Xuất xứ: Thefaceshop - Korea.\r\nKem trang điểm đa năng, che khuyết điểm hoàn hảo, bổ sung chất chống oxy hóa giúp làm sáng và ngăn ngừa các dấu hiệu lão hóa sớm cho da.', '<p><span style="font-size: small; color: #000000;"><a title="BB Cream Magic Cover SPF37 PA++ " href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/BB-Cream-Magic-Cover-SPF20-PA---"><strong><strong>BB Cream</strong> Magic Cover SPF37 PA++&nbsp;</strong></a><br /></span></p>\r\n<p><span style="font-size: small; color: #000000;">Dung t&iacute;ch : 45ml</span></p>\r\n<p><span style="font-size: small; color: #000000;">Kem l&oacute;t trang điểm đa năng với c&ocirc;ng thức th&ocirc;ng minh, chứa c&aacute;c hạt dưỡng chất DNA được bao bọc bởi lớp m&agrave;ng bảo vệ sẽ tự động k&iacute;ch hoạt v&agrave; thẩm thấu chất chống oxy h&oacute;a (Vitamin C, E) v&agrave;o da khi da tiếp x&uacute;c với &aacute;nh nắng mặt trời.</span></p>\r\n<p><span style="font-size: small; color: #000000;"> Đồng thời, <strong><a title="BB Cream Magic Cover" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/BB-Cream-Magic-Cover-SPF20-PA---"><strong>BB Cream</strong>&nbsp;Magic Cover</a>&nbsp;</strong>nhờ th&agrave;nh phần Dolwoe v&agrave; L&ecirc; Rừng trong sản phẩm gi&uacute;p l&agrave;m trắng v&agrave; ngăn ngừa c&aacute;c dấu hiệu l&atilde;o h&oacute;a sớm, duy tr&igrave; sự tươi s&aacute;ng v&agrave; rạng rỡ l&acirc;u d&agrave;i cho l&agrave;n da.</span></p>\r\n<p><span style="font-size: small; color: #000000;">C&oacute; 2 tone m&agrave;u : 01 - m&agrave;u s&aacute;ng v&agrave; 02 - tự nhi&ecirc;n.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: small; color: #000000;">&nbsp;</span></p>\r\n<p><span style="font-size: small; color: #000000;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p>\r\n<p><span style="font-size: small; color: #000000;">&nbsp;</span></p>\r\n<p><span style="font-size: small; color: #000000;">&nbsp;</span></p>', '2014_02_25_22_53_04-shopmyphamhan-BB-Cream-Magic-Cover-SPF37-PA++.jpg', 350000, 330000, 'BBTFS04', 1, '0', 0, 3, '1', '1', '1', 1385538402),
(4, 20, 'BB Cream ', 'Red Bean BB Cream SPF 20 PA+ - BB Cream Skinfood Chiết Xuất Đậu Đỏ', 'red-bean-bb-cream-spf-20-pa-bb-cream-skinfood-chit-xut-u-', 'Xuất Xứ : Skinfood - Korea.\r\nĐây là dòng sản phẩm BB Cream dành cho da thường, da hỗn hợp.', '<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: small;" data-mce-mark="1">Red Bean BB Cream SPF 20 PA+ - BB Cream Skinfood Chiết Xuất Đậu Đỏ</span></strong></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;" data-mce-mark="1">Trọng lượng : 50g.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;" data-mce-mark="1">Đ&acirc;y l&agrave; d&ograve;ng sản phẩm <strong>BB Cream d&agrave;nh cho da thường, da hỗn hợp</strong>, với độ che phủ cao c&ugrave;ng m&ugrave;i thơm nhẹ nh&agrave;ng, dưỡng chất tốt, <strong>BB Cream đậu đỏ</strong> l&agrave; sản phẩm kh&ocirc;ng thể thiếu trong bộ sưu tập Skinfood.</span></p>\r\n<p style="text-align: center;"><span style="font-family: arial, helvetica, sans-serif; font-size: small;" data-mce-mark="1"><img title="Red Bean BB Cream SPF 20 PA+ - BB Cream Skinfood Chiết Xuất Đậu Đỏ" src="/uploads/details/Products/img_prod/bb-dau-do.jpg" alt="Red Bean BB Cream SPF 20 PA+ - BB Cream Skinfood Chiết Xuất Đậu Đỏ" /></span></p>\r\n<p><br /><span style="font-family: arial, helvetica, sans-serif; font-size: small;">Red Bean BB Cream SPF 20 PA+ lỏng hơn so với c&aacute;c BB kh&aacute;c n&ecirc;n khi d&ugrave;ng, n&oacute; tạo một lớp kh&aacute; mỏng tr&ecirc;n bề mặt da, b&ecirc;n cạnh khả năng chống nắng, BB đậu đỏ c&oacute; một đặc điểm nữa l&agrave; kh&ocirc;ng bị xuống m&agrave;u sau thời gian d&agrave;i make up.</span></p>', '2014_01_17_16_26_24-shopmyphamhan-bb-dau-do-1.jpg', NULL, 240000, 'BBSF007', -3, '0', 0, 4, '1', '1', '1', 1385640330),
