(10, 72, 'Costar', 'Kem Nhau Thai Cừu Costar Lanolin Cream With Vitamin E 100g', 'kem-nhau-thai-cu-costar-lanolin-cream-with-vitamin-e-100g', 'Xuất xứ :Costar - Australia\r\n', '<p><span style="color: #000000; font-size: small;"><strong>Kem Nhau Thai Cừu Costar Lanolin Cream With Vitamin E 100g</strong></span></p>\r\n<p><span style="color: #000000; font-size: small;">Trọng lượng: 100g<strong><br /></strong></span></p>\r\n<p><span style="font-size: small; color: #000000;"><span style="color: #000000; font-size: small;"><strong>Kem Nhau Thai Cừu Costar Lanolin Cream With Vitamin E 100g</strong></span>&nbsp;với th&agrave;nh phần chủ yếu chiết xuất từ mỡ cừu, c&oacute; th&ecirc;m Placenta (nhau thai cừu), bổ sung th&ecirc;m vitamin E, nhẹ nh&agrave;ng nu&ocirc;i dưỡng l&agrave;n da, v&agrave; duy tr&igrave; sự mượt m&agrave; cho l&agrave;n da, hộp 100g do Viện Dược phẩm &Uacute;c nghi&ecirc;n cứu v&agrave; ph&aacute;t triển.</span></p>\r\n<p><span style="font-size: small; color: #000000;">- Lanolin v&agrave; vitamin E l&agrave;m mềm mại l&agrave;n da.</span></p>\r\n<p><span style="font-size: small; color: #000000;">- Chiết xuất nhau thai cừu gi&uacute;p l&agrave;m trắng da, giảm nếp nhăn, chất hydro kh&ocirc;ng b&atilde;o h&ograve;a thấm s&acirc;u v&agrave;o da v&agrave; giải độc tố cho da.</span></p>\r\n<p><span style="font-size: small; color: #000000;">- Vitamin E l&agrave;m mềm mại l&agrave;n da, tăng cường độ ẩm, v&agrave; th&uacute;c đẩy qu&aacute; tr&igrave;nh t&aacute;i tạo tế b&agrave;o mới.</span></p>\r\n<p><span style="font-size: small; color: #000000;">- Kem l&agrave;m từ c&aacute;c tinh chất tự nhi&ecirc;n n&ecirc;n kh&ocirc;ng bị k&iacute;ch ứng da, ho&agrave;n to&agrave;n kh&ocirc;ng độc hại.</span></p>\r\n<p><span style="font-size: small; color: #000000;">- Th&iacute;ch hợp với tất cả mọi loại da, đặc biệt l&agrave; da kh&ocirc;/ với bất kỳ lứa tuổi.</span></p>\r\n<p><span style="font-size: small; color: #000000;">- C&oacute; thể được sử d&ugrave;ng l&agrave;m kem dưỡng mặt hoặc dưỡng cơ thể.</span></p>\r\n<p><span style="font-size: small; color: #000000;">- D&ugrave;ng được cho trẻ nhỏ v&agrave; phụ nữ mang thai chữa nẻ</span></p>\r\n<p><span style="font-size: small; color: #000000;">- Sản phẩm n&agrave;y rất tốt cho chăm s&oacute;c tay v&agrave; dưỡng cơ thể. Bạn c&ograve;n c&oacute; thể đặt trong nh&agrave; bếp để sử dụng khi tay bị kh&ocirc;.</span></p>\r\n<p><span style="font-size: small; color: #000000;"><span style="text-decoration: underline;">C&Ocirc;NG DỤNG:</span></span></p>\r\n<p><span style="font-size: small; color: #000000;">- Cung cấp dưỡng chất cho l&agrave;n da, ngăn ngừa l&otilde;a h&oacute;a, ngăn ngừa chảy xệ gi&uacute;p l&agrave;n da đ&agrave;n hồi tốt hơn, giảm c&aacute;c nếp nhăn tr&ecirc;n da, ngăn ngừa c&aacute;c đốm n&acirc;u đồi mồi do Lanolin được cung cấp th&ecirc;m vitamin E.</span></p>\r\n<p><span style="font-size: small; color: #000000;">- Cung cấp v&agrave; giữ ẩm cho l&agrave;n da suốt 24h. Đặc biệt b&ocirc;i l&ecirc;n mặt kh&ocirc;ng bị b&oacute;ng nhờn m&agrave; c&ograve;n cảm gi&aacute;c rất mềm v&agrave; m&aacute;t, ngay cả da thuộc loại vừa dầu vừa kh&ocirc; b&ocirc;i cũng rất hợp.</span></p>\r\n<p><span style="font-size: small; color: #000000;">- LANOLIN d&ugrave;ng trị nẻ trong m&ugrave;a đ&ocirc;ng rất tốt. D&ugrave;ng tốt cả trẻ con nữa đấy! Rất l&agrave;nh cho da, kh&ocirc;ng k&iacute;ch ứng, kh&ocirc;ng g&acirc;y cảm gi&aacute;c kh&oacute; chịu cho b&eacute; y&ecirc;u!</span></p>\r\n<p><span style="font-size: small; color: #000000;">- LANOLIN c&ograve;n c&oacute; thể xử l&yacute; được c&aacute;c vết ch&agrave;m trẻ em.</span></p>\r\n<p><span style="font-size: small; color: #000000;">- LANOLIN d&ugrave;ng rất tốt cho những người bị nấm tổ đỉa, nứt kẽ tay, kẽ ch&acirc;n, chảy m&aacute;u v&agrave;o m&ugrave;a đ&ocirc;ng, b&ocirc;i l&ecirc;n da sẽ thấy m&aacute;t lạnh v&agrave; mềm da.</span></p>\r\n<p><span style="font-size: small; color: #000000;">&nbsp;</span></p>', '2014_