(15, 7, 'BB Cream - CC Cream - Kem Nền - TFS', 'BB Cream Face It Power Perfection SPF37 PA++ ', 'bb-cream-face-it-power-perfection-spf37-pa', 'Xuất xứ: Thefaceshop - Korea.\r\nTính năng: làm trắng da, chống lão hóa và chống nhăn nhằm bảo vệ với độ che phủ SPF37.', '<p>&nbsp;</p>\r\n<p><span style="font-size: small; color: #000000;">Dung t&iacute;ch : 40ml.</span></p>\r\n<p><span style="font-size: small; color: #000000;">Đ&acirc;y l&agrave; sản phẩm BB cream chiết xuất từ Omega 3 v&agrave; phức hợp vita skin gi&uacute;p th&uacute;c đẩy sự sinh sản collagen v&agrave; phục hồi da, đem lại cho bạn một l&agrave;n da tr&agrave;n đầy sức sống v&agrave; s&aacute;ng khỏe. </span></p>\r\n<p><span style="font-size: small; color: #000000;"><span style="font-size: small;">Sản phẩm c&oacute; 2 tone: Tone s&aacute;ng v&agrave; tone tự nhi&ecirc;n </span></span></p>\r\n<p><span style="font-size: small; color: #000000;"><strong><a title="BB Cream Face It Power Perfection SPF37 PA++" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/BB-Cream-Face-It-Power-Perfection-SPF37-PA---">BB Cream Face It Power Perfection SPF37 PA++</a>&nbsp;</strong>&nbsp;d&ugrave;ng được cho tất cả loại da, chủ động giải quyết những vấn đề về da như da kh&ocirc;, mất độ săn chắc, da xỉn m&agrave;u, kết cấu da kh&ocirc;ng đồng đều. </span></p>\r\n<p><span style="font-size: small; color: #000000;"><a title="BB cream l&agrave;m trắng da, chống l&atilde;o h&oacute;a v&agrave; chống nhăn" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/BB-Cream-Face-It-Power-Perfection-SPF37-PA---">BB cream l&agrave;m trắng da, chống l&atilde;o h&oacute;a v&agrave; chống nhăn</a>, bảo vệ da khỏi &aacute;nh nắng mặt trời với độ che phủ ho&agrave;n hảo. Mang lại cảm gi&aacute;c thoải m&aacute;i, dễ chịu cho da Kết quả trang điểm tinh tế, l&acirc;u d&agrave;i .</span></p>\r\n<p><span style="font-size: small; color: #000000;"><img title="BB Cream Face It Power Perfection SPF37 PA++ 2" src="/uploads/img_product_detail/BBCreamFace%20ItPo