(16, 7, 'BB Cream - CC Cream - Kem Nền - TFS', ' CC Cream Thefaceshop Aura Color Control Cream SPF30 PA++', 'cc-cream-thefaceshop-aura-color-control-cream-spf30-pa', 'Xuất xứ: Thefaceshop - Korea.', '<p><a title=" CC Cream Thefaceshop Aura Color Control Cream SPF30 PA++" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/-CC-Cream-Thefaceshop-Aura-Color-Control-Cream-SPF30-PA--"><span style="font-size: small; color: #000000;">&nbsp;<strong>CC Cream <span style="font-size: small; color: #000000;">Thefaceshop&nbsp;</span>Aura Color Control Cream SPF30 PA++</strong></span></a></p>\r\n<p><span style="font-size: small; color: #000000;">Trọng lượng : 20g</span></p>\r\n<p><span style="font-size: small; color: #000000;"><a title=" CC Cream Aura Color" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/-CC-Cream-Thefaceshop-Aura-Color-Control-Cream-SPF30-PA--"><strong>&nbsp;<span style="font-size: small; color: #000000;">CC Cream</span><span style="font-size: small; color: #000000;">&nbsp;</span></strong></a><span style="font-size: small; color: #000000;"><a title=" CC Cream Aura Color" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/-CC-Cream-Thefaceshop-Aura-Color-Control-Cream-SPF30-PA--"><strong>Aura Color</strong></a>&nbsp;</span>l&agrave; một xu hướng trang điểm mới , vượt mặt những g&igrave; BB Cream đang nắm giữ. CC Cream (Color Corrector), được tạm dịch l&agrave; &ldquo;điều chỉnh sắc m&agrave;u&rdquo;, với những vượt trội hơn so với BB Cream:</span></p>\r\n<p><span style="font-size: small; color: #000000;">CC Cream mỏng, mịn hơn BB cream v&agrave; khả năng che phủ tốt, mang lại vẻ đẹp tự nhi&ecirc;n.</span></p>\r\n<p><span style="font-size: small; color: #000000;">CC Cream kết cấu dạng lỏng, mỏng, nhẹ, tạo cảm gi&aacute;c dễ chịu, nhẹ nh&agrave;ng hơn, kh&ocirc;ng g&acirc;y b&iacute; da.</span></p>\r\n<p><span style="font-size: small; color: #000000;">Nhờ kết cấu lỏng n&ecirc;n <a title="Aura Color Control Cream điều chỉnh sắc da ho&agrave;n hảo" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/-CC-Cream-Thefaceshop-Aura-Color-Control-Cream-SPF30-PA--"><strong>Aura Color Control Cream&nbsp;điều chỉnh sắc da ho&agrave;n hảo</strong></a> hơn so với, nhất l&agrave; những bạn c&oacute; tone m&agrave;u da t&aacute;i xanh hoặc l&agrave;n da ngăm tự nhi&ecirc;n nhi&ecirc;n. V&igrave; c&ocirc;ng dụng của CC Cream l&agrave; điều chỉnh sắc da n&ecirc;n mang đến sự mượt m&agrave; tinh tế trong m&agrave;u sắc. Đặc biệt, bạn c&oacute; thể phối hợp trộn chung với kem nền (Foundation) v&agrave; che khuyết điểm nếu muốn </span></p>\r\n<p><span style="font-size: small; color: #000000;">CC Cream thừa hưởng hầu như to&agrave;n bộ chức năng dưỡng da của BB cream: c&acirc;n bằng độ ẩm-chống nắng-l&agrave;m trắng da.</span></p>\r\n<p><span style="font-size: small; color: #000000;">C&oacute; 2 tone m&agrave;u : 01 - m&agrave;u s&aacute;ng v&agrave; 02 - tự nhi&ecirc;n.</span></p>\r\n<p><span style="font-size: small; color: #000000;"><img title=" CC Cream Thefaceshop Aura Color Control Cream SPF30 PA++ 1" src="/uploads/img_product_detail/CC-Cream-Aura-Color-Thefaceshop-SPF30-PA%2B%2B.jpg" alt=" CC Cream Thefaceshop Aura Color Control Cream SPF30 PA++ 1" width="640" height="427" /></span></p>\r\n<p>&nbsp;</p>', '2014_02_25_22_40_33-shopmyphamhan-CCCream AuraColorSPF30PA++.jpg', 440000, 410000, 'CCTFS01', 1, '0', 0, 0, '1', '1', '1', 1392741443),
(17, 18, 'Mascara - Eyeliner - TFS', ' Bột Vẽ Chân Mày Designing Cake Eyebrow Thefaceshop', '-Bot-Ve-Chan-May-Designing-Cake-Eyebrow-Thefaceshop', 'Xuất xứ : Thefaceshop - Korea.\r\nBột vẽ chân mày dạng phấn giúp tạo đôi chân mày thật tự nhiên mà không gây vón cục.', '<div class="TabbedPanelsContentGroup">\r\n<div class="TabbedPanelsContent noidungsanpham TabbedPanelsContentVisible">\r\n<p><strong><span style="font-size: small;">Bột Vẽ Ch&acirc;n M&agrave;y Designing Cake Eyebrow&nbsp;<strong><span>Thefaceshop</span></strong></span></strong></p>\r\n<p><span style="font-size: small;">Trọng lượng : 4g</span></p>\r\n<p><span style="font-size: small;">Bột vẽ ch&acirc;n mày dạng phấn giúp tạo đ&ocirc;i ch&acirc;n mày th&acirc;̣t tự nhi&ecirc;n mà kh&ocirc;ng g&acirc;y vón cục.</span></p>\r\n<p><span style="font-size: small;"><strong>Designing Cake Eyebrow</strong>&nbsp;l&agrave; sản phẩm bột kẻ ch&acirc;n m&agrave;y với độ b&aacute;m m&agrave;u tốt, si&ecirc;u mịn mang lại đ&ocirc;i l&ocirc;ng m&agrave;y tự nhi&ecirc;n v&agrave; mềm mại. Sản phẩm gồm 2 &ocirc; m&agrave;u,th&iacute;ch hợp cho bạn tạo đ&ocirc;i ch&acirc;n m&agrave;y theo &yacute; th&iacute;ch, k&egrave;m theo 2 c&acirc;y cọ nhỏ, 1 để t&aacute;n m&agrave;u v&agrave; 1 để chải m&agrave;y.</span></p>\r\n</div>\r\n</div>\r\n<div class="clear"><span style="font-size: small;">&nbsp;</span></div>\r\n<div><span style="font-size: small;">&nbsp;</span></div>', '2014_02_26_13_05_22-shopmyphamhan-Bot-Ve-Chan-May-Designing-Cake-Eyebrow-Thefaceshop.jpg', 175000, 160000, 'EYEBTFS02', 1, '0', 0, 0, '1', '1', '1', 1392792105),
(18, 18, 'Mascara - Eyeliner - TFS', ' Mascara chân mày Thefaceshop Lovely MEEX Color My Eyebrow', 'mascara-chn-my-thefaceshop-lovely-meex-color-my-eyebrow', 'Xuất xứ : Thefaceshop - Korea.\r\nĐây là sản phẩm mascara giúp tạo dáng và đổi màu chân mày mà vẫn giữ vẻ tự nhiên, mềm mại cho chân mày của bạn.\r\n', '<p><a title="Mascara ch&acirc;n m&agrave;y Thefaceshop Lovely MEEX Color My Eyebrow" href="/shop/Mascara---Eyeliner---TFS/-Mascara-chan-may-Thefaceshop-Lovely-MEEX-Color-My-Eyebrow"><strong><span style="font-size: small;">Mascara ch&acirc;n m&agrave;y Thefaceshop Lovely MEEX Color My Eyebrow</span></strong></a></p>\r\n<p><span style="font-size: small;">Dung t&iacute;ch : 6ml</span></p>\r\n<p><span style="font-size: small;">Đ&acirc;y l&agrave; sản phẩm <a title="mascara gi&uacute;p tạo d&aacute;ng v&agrave; đổi m&agrave;u ch&acirc;n m&agrave;y" href="/shop/Mascara---Eyeliner---TFS/-Mascara-chan-may-Thefaceshop-Lovely-MEEX-Color-My-Eyebrow"><strong>mascara gi&uacute;p tạo d&aacute;ng v&agrave; đổi m&agrave;u ch&acirc;n m&agrave;y</strong></a> m&agrave; vẫn giữ vẻ tự nhi&ecirc;n, mềm mại cho ch&acirc;n m&agrave;y của bạn.<br /><br /><span style="font-size: small;">Sản phẩm được kết cấu dạng gel gi&uacute;p giữ nếp v&agrave; b&aacute;m m&agrave;u mang lại vẻ đẹp cho l&ocirc;ng m&agrave;y của bạn suốt cả ng&agrave;y d&agrave;i m&agrave; kh&ocirc;ng bị lem tr&ocirc;i hay bị phai m&agrave;u như c&aacute;c sản phẩm kh&aacute;c!<br /><br />Bạn c&oacute; thể kết hợp kẻ bằng ch&igrave; trước sau đ&oacute; tiếp tục sử dụng <a title="Lovely MEEX Color My Eyebrow" href="/shop/Mascara---Eyeliner---TFS/-Mascara-chan-may-Thefaceshop-Lovely-MEEX-Color-My-Eyebrow"><strong>Lovely MEEX Color My Eyebrow</strong></a> để c&oacute; đ&ocirc;i l&ocirc;ng m&agrave;y ho&agrave;n hảo v&agrave; bền m&agrave;u nhất!<br /><br />C&oacute; 2 m&agrave;u:<br />#01 Gray Brown - M&agrave;u n&acirc;u tự nhi&ecirc;n<br />#02 Light Brown - M&agrave;u n&acirc;u &aacute;nh đỏ<br /><br /><span style="tex