(20, 18, 'Mascara - Eyeliner - TFS', ' Viền mắt dạng sáp Make Me Star Waterproof Gel Liner', 'vin-mt-dng-sp-make-me-star-waterproof-gel-liner', 'Xuất xứ : Thefaceshop - Korea.\r\nSản phẩm mới của Thefaceshop, chì vẽ mắt có nhũ, không lem, không trôi. Cho đôi mắt thêm sắc sảo và ấn tượng.', '<p><a title="Viền mắt dạng s&aacute;p Make Me Star Waterproof Gel Liner" href="/shop/Mascara---Eyeliner---TFS/-Vien-mat-dang-sap-Make-Me-Star-Waterproof-Gel-Liner"><span style="font-size: small;"><strong><strong>Viền mắt dạng s&aacute;p&nbsp;</strong>Make Me Star Waterproof Gel Liner</strong></span></a></p>\r\n<p><span style="font-size: small;">Dung t&iacute;ch : 1.8g</span></p>\r\n<p><span style="font-size: small;">Sản phẩm mới Thefaceshop, <a title="ch&igrave; vẽ mắt c&oacute; nhũ" href="/shop/Mascara---Eyeliner---TFS/-Vien-mat-dang-sap-Make-Me-Star-Waterproof-Gel-Liner"><strong>ch&igrave; vẽ mắt c&oacute; nhũ</strong></a>,&nbsp;kh&ocirc;ng lem, kh&ocirc;ng tr&ocirc;i. Cho đ&ocirc;i mắt th&ecirc;m sắc sảo v&agrave; ấn tượng.</span></p>\r\n<p><a title="Viền mắt dạng s&aacute;p " href="/shop/Mascara---Eyeliner---TFS/-Vien-mat-dang-sap-Make-Me-Star-Waterproof-Gel-Liner"><strong style="font-size: small;">Viền mắt dạng s&aacute;p</strong></a><span style="font-size: small;"> chiết xuất từ dầu dừa v&agrave; vitamin E tạo đường n&eacute;t sắc n&eacute;t cho đ&ocirc;i mắt.</span></p>\r\n<p>&nbsp;<span style="font-size: small;">Ch&igrave; kẻ mắt 2 đầu, 1 đầu ch&igrave;, 1 đầu cọ để t&aacute;n.</span></p>', '2014_02_26_11_42_30-shopmyphamhan-Vien-Mat-Dang-Sap-Make-Me-Star-Waterproof-Gel-Liner.jpg', NULL, 120000, 'LINERTFS2', 1, '0', 0, 0, '1', '1', '1', 1392793043),
(21, 18, 'Mascara - Eyeliner - TFS', ' Mascara Không Trôi Waterproof 01 Super Proof ', 'mascara-khng-tri-waterproof-01-super-proof', 'Xuất xứ : Thefaceshop - Korea.\r\nĐây là sản phẩm mascara chống thấm nước làm dài và khô mi tức thì.', '<p><a title="Mascara Kh&ocirc;ng Tr&ocirc;i Waterproof 01 Super Proof " href="/shop/Mascara---Eyeliner---TFS/mascara-khng-tri-waterproof-01-super-proof"><span style="font-size: small;"><strong>Mascara Kh&ocirc;ng Tr&ocirc;i Waterproof 01 Super Proof&nbsp;</strong></span></a></p>\r\n<p><span style="font-size: small;">Trọng Lượng: 9g</span></p>\r\n<p><span style="font-size: small;">Đ&acirc;y l&agrave; sản phẩm&nbsp;<a title="mascara chống thấm nước" href="/shop/Mascara---Eyeliner---TFS/mascara-khng-tri-waterproof-01-super-proof"><strong>mascara chống thấm nước</strong></a> l&agrave;m d&agrave;i v&agrave; kh&ocirc; mi tức th&igrave;.</span></p>\r\n<p><span style="font-size: small;">Mascara l&acirc;u tr&ocirc;i gi&uacute;p h&agrave;ng mi cong v&agrave; d&agrave;y tối ưu.</span></p>\r\n<p><span style="font-size: small;"><a title="Face It Waterproof Mascara" href="/shop/Mascara---Eyeliner---TFS/mascara-khng-tri-waterproof-01-super-proof"><strong>Face It Waterproof Mascara</strong></a> #01 Super Proof&nbsp;th&iacute;ch hợp d&ugrave;ng cho đi biển, đi bơi hoặc người da dầu, hay đổ mồ h&ocirc;i nhiều, ho&agrave;n to&agrave;n kh&ocirc;ng thấm nước, gi&uacute;p l&agrave;n mi kh&ocirc;ng tr&ocirc;i khi gặp nước!</span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;"><span style="font-size: small;">Hướng Dẫn Sử Dụng :</span></span></span></p>\r\n<p>&nbsp;<span style="font-size: small;">Chải mascara theo h&igrave;nh ziczac từ trong ra ngo&agrave;i.</span></p>\r\n<p>&nbsp;</p>', '2014_02_26_11_51_24-shopmyphamhan-Mascara-Không-Trôi-Waterproof-01-Super-Proof.jpg', NULL, 195000, 'MASSTFS1', 1, '0', 0, 0, '1', '1', '1', 1392793226),
(22, 18, 'Mascara - Eyeliner - TFS', 'Viền Mắt Styling Auto Gel Liner ', 'vin-mt-styling-auto-gel-liner', 'Xuất xứ : Thefaceshop - Korea.\r\nChì kẻ mắt mới ra của Thefaceshop , đầu chì mềm dễ kẻ , nét chì đậm sắc nét và lâu trôi như kẻ gel eyeliner.', '<p><a title="Viền Mắt Styling Auto Gel Liner " href="/shop/Mascara---Eyeliner---TFS/vin-mt-styling-auto-gel-liner"><strong><span style="font-size: small;">Viền Mắt Styling Auto Gel Liner&nbsp;</span></strong></a></p>\r\n<p><span style="font-size: small;">Trọng lượng: 0.6g</span></p>\r\n<p><span style="font-size: small;"><a title="Ch&igrave; kẻ mắt dạng gel mới ra của Thefaceshop" href="/shop/Mascara---Eyeliner---TFS/vin-mt-styling-auto-gel-liner"><strong>Ch&igrave; kẻ mắt dạng gel mới ra của Thefaceshop</strong></a>&nbsp;, đầu ch&igrave; mềm dễ kẻ , n&eacute;t ch&igrave; đậm sắc n&eacute;t v&agrave; l&acirc;u tr&ocirc;i như kẻ&nbsp;<a title="gel eyeliner, gi&uacute;p đ&ocirc;i mắt c&oacute; đường viền sắc n&eacute;t" href="/shop/Mascara---Eyeliner---TFS/vin-mt-styling-auto-gel-liner"><strong>gel eyeliner,&nbsp;</strong></a><a title="gel eyeliner, gi&uacute;p đ&ocirc;i mắt c&oacute; đường viền sắc n&eacute;t" href="/shop/Mascara---Eyeliner---TFS/vin-mt-styling-auto-gel-liner"><strong>gi&uacute;p đ&ocirc;i mắt c&oacute; đường viền sắc n&eacute;t</strong></a>&nbsp;với độ b&aacute;m d&iacute;nh cao.</span></p>\r\n<p><span style="font-size: small;">Đ&acirc;y l&agrave; sản phẩm eyeliner mới nhất kết hợp độc đ&aacute;o dạng gel,<strong><a title="Styling Auto Gel Liner" href="/shop/Mascara---Eyeliner---TFS/vin-mt-styling-auto-gel-liner">&nbsp;Styling Auto Gel Liner</a>&nbsp;</strong>với độ mịn v&agrave; b&aacute;m m&agrave;u cao,&nbsp;<a title="chống thấm nước" href="/shop/Mascara---Eyeliner---TFS/vin-mt-styling-auto-gel-liner"><strong>chống thấm nước</strong></a>&nbsp;ho&agrave;n to&agrave;n, cho đường viền m&iacute; r&otilde; n&eacute;t, ph&ugrave; hợp với đi biển, đi bơi, đi mưa m&agrave; kh&ocirc;ng hề lo lắng việc eyeliner bị lem tr&ocirc;i.</span></p>\r\n<p><span style="font-size: small;"><img title="Viền Mắt Styling Auto Gel Liner  1" src="/uploads/img_product_detail/Vien-Mat-Styling-Auto-Gel-Liner-0.jpg" alt="Viền Mắt Styling Auto Gel Liner  1" width="522" height="451" /></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2014_02_26_12_06_10-shopmyphamhan-Vien-Mat-Styling-Auto-Gel-Liner.jpg', NULL, 160000, 'LINERTFS03', 1, '0', 0, 0, '0', '1', '1', 1392793390),
(23, 17, 'Phấn Nền - Phấn Phủ - TFS', 'Phấn Nền Collagen Ex Two Way Cake SPF30 PA+++', 'phn-nn-collagen-ex-two-way-cake-spf30-pa', 'Xuất xứ : Thefaceshop - Korea.\r\nPhấn nền chống nắng che phủ hoàn hảo với kết cấu hạt phấn cực mịn và giàu ẩm giúp duy trì sự ẩm mượt và mịn màng cho da suốt cả ngày.', '<p>&nbsp;<a title="Phấn Nền Collagen Ex Two Way Cake SPF30 PA+++" href="/shop/Phan-Nen---Phan-Phu---TFS/Phan-Nen-Collagen-Ex-Two-Way-Cake-SPF30-PA---"><strong><span style="font-size: small;">Phấn Nền Collagen Ex Two Way Cake SPF30 PA+++</span></strong></a></p>\r\n<p><span style="font-size: small;">Trọng lượng : 12g</span></p>\r\n<p><span style="font-size: small;">Đ&acirc;y l&agrave; sản phẩm <a title="phấn n&eacute;n cao cấp" href="/shop/Phan-Nen---Phan-Phu---TFS/Phan-Nen-Collagen-Ex-Two-Way-Cake-SPF30-PA---"><strong>phấn n&eacute;n cao cấp</strong></a> 2 trong 1 vừa l&agrave; nền, vừa l&agrave; phủ với th&agrave;nh phần <a title="collagen" href="/shop/Phan-Nen---Phan-Phu---TFS/Phan-Nen-Collagen-Ex-Two-Way-Cake-SPF30-PA---"><strong>collagen</strong></a>, c&oacute; t&aacute;c dụng l&agrave;m da săn chắc, căng mịn, kết hợp với th&agrave;nh phần chống nắng SPF30 PA+++, <a title="Collagen Ex Two Way Cake" href="/shop/Phan-Nen---Phan-Phu---TFS/Phan-Nen-Collagen-Ex-Two-Way-Cake-SPF30-PA---"><strong>Collagen Ex Two Way Cake</strong></a>&nbsp;tạo n&ecirc;n một lớp che phủ tối ưu, cho bạn một gương mặt ho&agrave;n hảo v&agrave; rạng rỡ.</span></p>\r\n<p><span style="font-size: small;">C&oacute;&nbsp; 2 tone m&agrave;u: NB21 :s&aacute;ng , NB23: Tự nhi&ecirc;n.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style="font-size: small;"><img title="Phấn Nền Collagen Ex Two Way Cake SPF30 PA+++ 21" src="/uploads/img_product_detail/Phan-Nen-Collagen-Ex-Two-Way-Cake-SPF30-PA%2B%2B%2B.jpg" alt="Phấn Nền Collagen Ex Two Way Cake SPF30 PA+++ 21" width="282" height="304" /> NB21&nbsp; <img title="Phấn Nền Collagen Ex Two Way Cake SPF30 PA+++ 23" src="/uploads/img_product_