(37, 20, 'BB Cream ', ' BB cream chiết xuất xương rồng AGAVE CACTUS SUN BB CREAM SPF36 PA+++ ', 'bb-cream-chit-xut-xng-rng-agave-cactus-sun-bb-cream-spf36-pa', 'Xuất xứ : Skinfood - Korea ', '<p><span style="font-size: small; color: #800080;"><strong>&nbsp;<span style="color: #000000;"><span style="font-size: small;">BB Cream Skinfood chiết xuất xương rồng</span> AGAVE CACTUS SUN BB CREAM SPF36 PA+++</span></strong><span style="color: #000000;"> ( cho da thường, da kh&ocirc;)</span></span><br /><br /><span style="font-size: small; color: #000000;">Chứa chiết xuất xương rồng Agave gi&uacute;p giữ ẩm cho da suốt ng&agrave;y, kem chống nắng kh&ocirc;ng nhờn d&iacute;nh gi&uacute;p l&agrave;m m&aacute;t v&agrave; dưỡng ẩm cho da, đồng thời bảo vệ da khỏi t&aacute;c hại của tia UV.</span><br /><br /><span style="font-size: small; color: #000000;">Hướng dẫn sử dụng:</span><br /><br /><span style="font-size: small; color: #800080;"><span style="color: #000000;">B&oacute;p nhẹ chai v&agrave; d&ugrave;ng đầu m&uacute;t tr&ecirc;n đầu chai thoa một lượng vừa đủ l&ecirc;n da. Thay mới hoặc l&agrave;m sạch đầu m&uacute;t bằng nước ấm sau khi sử dụng</span>.</span><br /><br /></p>', '2014_02_19_14_49_10-shopmyphamhan-BB_xuong_rong.jpg', NULL, 355000, 'BBSF04', 1, '0', 0, 0, '0', '1', '1', 1392796150),
(38, 53, 'Phấn Phủ Bột - Powder', ' Phấn phủ Skinfood Kiều mạch - Buckwheat Powder ', 'phn-ph-skinfood-kiu-mch-buckwheat-powder', 'Xuất xứ : Skinfood - Korea.\r\nPhấn phủ dạng bột giúp làn da trở nên đẹp mịn màng mang lại vẻ đẹp tự nhiên.', '<p><a href="/shop/Phan-Nen---Phan-Phu/-Phan-phu-Skinfood-Kieu-mach---Buckwheat-Powder-"><span style="color: #000000;"><strong><span style="color: #000000;"><span style="font-size: small;"><strong><span style="color: #000000;">Phấn phủ Skinfood chiết xuất kiều mạch </span></strong>- Buckwheat Loose Powder</span>&nbsp;</span></strong></span></a></p>\r\n<p><span style="font-size: small; color: #000000;">Trọng lượng : 23g </span></p>\r\n<p><span style="font-size: small; color: #000000;"><a href="/shop/Phan-Nen---Phan-Phu/-Phan-phu-Skinfood-Kieu-mach---Buckwheat-Powder-"><strong><span style="font-size: small; color: #000000;"><strong><span style="font-size: small; color: #000000;">Phấn phủ Skinfood chiết xuất kiều mạch&nbsp;</span></strong>- Buckwheat Loose Powder</span></strong></a>&nbsp;dạng bột gi&uacute;p l&agrave;n da trở n&ecirc;n đẹp mịn m&agrave;ng mang lại vẻ đẹp rạng rỡ v&agrave; ho&agrave;n hảo.</span></p>\r\n<p><span style="font-size: small; color: #000000;">Chiết xuất kiều mạch l&agrave;m nổi bật t&ocirc;ng m&agrave;u của l&agrave;n da kh&ocirc;ng g&acirc;y b&oacute;ng nhờn mang lại l&agrave;n da mềm mịn cho bạn.</span><br /><br /><span style="font-size: small; color: #000000;"><span style="font-size: small; color: #000000;">Hướng dẫn sử dụng:</span></span></p>\r\n<p><span style="font-size: small;">Sau khi d&ugrave;ng phấn nền, phủ phấn phủ l&ecirc;n mặt theo tr&igrave;nh tự: tr&aacute;n, mắt, g&ograve; m&aacute;, m&ocirc;i v&agrave; tiếp tục phủ nhẹ v&ugrave;ng dưới mắt.</span></p>', '2014_02_19_14_55_27-shopmyphamhan-phấn phủ kiều mạch.jpg', 190000, 175000, 'PPSF01', 1, '0', 0, 0, '1', '1', '1', 1392796527),
