(42, 52, 'Phấn Nén - Pact', 'Carrot Pact - Phấn Phủ Cà Rốt', 'carrot-pact-phn-ph-c-rt', 'Xuất xứ : Skinfood - Korea.\r\nCarrot Pact - Phấn Phủ Cà Rốt thích hợp cho da nhạy cảm.', '<p><a href="/shop/Phan-Nen---Phan-Phu/Phan-Nen-Carrot---Carrot-Pact-"><span style="color: #000000; font-size: small;"><strong>Carrot Pact - Phấn Phủ C&agrave; Rốt</strong> </span></a></p>\r\n<p><span style="font-size: small;">Trọng Lượng :&nbsp;</span><br /><br /><span style="font-size: small;"><a href="/shop/Phan-Nen---Phan-Phu/Phan-Nen-Carrot---Carrot-Pact-"><strong>Carrot Pact - Phấn Phủ C&agrave; Rốt</strong></a>&nbsp;l&agrave; sản phẩm phấn phủ dạng n&eacute;n,với dinh dưỡng chiết xuất từ củ c&agrave; rốt được trồng ở đảo Jeju nổi tiếng ở H&agrave;n Quốc. Đ&acirc;y l&agrave; loại phấn phủ tạo lớp trang điểm nhẹ nh&agrave;ng, tự nhi&ecirc;n, tho&aacute;ng m&aacute;t th&iacute;ch hợp cho mọi loại da, đặc biệt l&agrave; <a href="/shop/Phan-Nen---Phan-Phu/Phan-Nen-Carrot---Carrot-Pact-"><strong>da nhạy cảm</strong></a>!</span><br /><br /><span style="font-size: small;">No.1- S&aacute;ng ; No. 2 - Tự nhi&ecirc;n</span><br /><br /><span style="text-decoration: underline;"><span style="font-size: small;">Hướng Dẫn Sử Dụng :</span></span></p>\r\n<p><span style="font-size: small;">D&ugrave;ng b&ocirc;ng phấn thoa nhẹ nh&agrave;ng tr&ecirc;n to&agrave;n khu&ocirc;n mặt trước rồi thoa v&agrave;o v&ugrave;ng chữ T, tr&aacute;nh miết b&ocirc;ng phấn để tạo độ mịn v&agrave; b&aacute;m phấn hơn.</span><br /><br /><span style="font-size: small;">&nbsp;</span><br /><br /></p>', '2014_02_19_15_03_43-shopmyphamhan-phấn carot.gif', 320000, 280000, 'PPSF03', 0, '0', 0, 1, '0', '1', '1', 1392797023),
(44, 16, 'Che khuyết Điểm - Má Hồng - TFS', 'Phấn Má Hồng Lovely Thefaceshop 04 baby Pink ', 'Phan-Ma-Hong-Lovely-Thefaceshop-04-baby-Pink-', 'Xuất xứ : Thefaceshop - Korea.\r\nMá hồng với kết cấu bột mịn mang đến phong cách trẻ trung, sôi động.', '<p><span style="font-size: small;"><strong><span style="font-size: small;"><span style="font-size: small;">Phấn M&aacute; Hồng Lovely&nbsp;<span style="font-size: small;">Thefaceshop</span>&nbsp;04 baby Pink&nbsp;</span></span></strong><span style="font-size: small;"><span style="font-size: small;">&nbsp;</span></span>&nbsp;</span></p>\r\n<p><span style="font-size: small;">Đ&acirc;y l&agrave; sản phẩm <strong>phấn m&aacute; hồng dạng n&eacute;n của Thefaceshop</strong>&nbsp;chứa c&aacute;c hạt phấn cực mịn, dễ d&agrave;ng phủ nhẹ bằng cọ trang điểm&nbsp;<span style="font-size: small;">với m&agrave;u sắc nhẹ nh&agrave;ng trẻ trung v&agrave; c&oacute; t&aacute;c dụng kiềm dầu, giữ cho&nbsp;</span></span><span style="font-size: small;">khu&ocirc;n mặt của bạn kh&ocirc; tho&aacute;ng, ko bị b&oacute;ng nhờn&nbsp;</span><span style="font-size: small;">mang lại vẻ ứng hồng tự nhi&ecirc;n như em b&eacute; , cho đ&ocirc;i g&ograve; m&aacute; l&agrave;m cho da mặt bạn th&ecirc;m phẩn tươi trẻ.</span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">C&aacute;ch d&ugrave;ng: </span></span></p>\r\n<p><span style="font-size: small;">D&ugrave;ng chổi b&ocirc;ng quẹt phấn v&agrave; tản đều tr&ecirc;n v&ugrave;ng m&aacute;.</span></p>', '2014_02_26_15_40_00-shopmyphamhan-Phan-Ma-Hong-LovelyThefaceshop04babyPink.jpg', 125000, 110000, 'MHTFS03', 1, '0', 0, 0, '0', '1', '1', 1392797134),
(46, 57, 'Eyeliner - Kẻ Viền Mắt', 'Kẻ mắt nước chiết xuất quả hạnh (không lem) -Eyeliner Skinfood Sweet Almond ', 'k-mt-nc-chit-xut-qu-hnh-khng-lem-eyeliner-skinfood-sweet-almond', 'Xuất xứ : Skinfood - Korea ', '<p><a title="Eyeliner Skinfood Sweet Almond - Kẻ mắt nước chiết xuất quả hạnh (kh&ocirc;ng lem)" href="/shop/Eyeliner---Mascara---Eyebrow/Ke-mat-nuoc-chiet-xuat-qua-hanh--khong-lem---Eyeliner-Skinfood-Sweet-Almond-"><span style="color: #000000;"><strong><span style="font-size: small;">Eyeliner Skinfood Sweet Almond - Kẻ mắt nước chiết xuất quả hạnh (kh&ocirc;ng lem)</span></strong></span></a><br /><span style="font-size: small; color: #000000;">Dung t&iacute;ch: 7ml</span></p>\r\n<p><span style="font-size: small; color: #000000;"><a title="Kẻ mắt nước chiết xuất tinh dầu quả hạnh Skinfood" href="/shop/Eyeliner---Mascara---Eyebrow/Ke-mat-nuoc-chiet-xuat-qua-hanh--khong-lem---Eyeliner-Skinfood-Sweet-Almond-"><strong>Kẻ mắt nước chiết xuất tinh dầu quả hạnh Skinfood</strong></a> gi&uacute;p l&agrave;m dịu v&ugrave;ng da nhạy cảm quanh mắt, mắt nước c&oacute; t&ocirc;ng m&agrave;u tối tạo n&eacute;t tự nhi&ecirc;n cho đ&ocirc;i mắt, kh&ocirc;ng lem, kh&ocirc;ng tr&ocirc;i.</span><br /><br /><span style="font-size: small; color: #000000;">Hướng dẫn sử dụng:</span><br /><span style="font-size: small; color: #000000;">D&ugrave;ng đầu cọ vẽ nhẹ nh&agrave;ng l&ecirc;n đường viền mắt</span></p>', '2014_02_19_15_10_05-shopmyphamhan-Eyeliner_SWEET_ALMOND.jpg', 150000, 130000, 'LINERSF01', 1, '0', 0, 0, '0', '1', '1', 1392797405),
(49, 70, 'Kem Dưỡng - Cream', 'Kem Dưỡng Chống Thâm Quầng Mắt Cá Hồi Skinfood - Salmon Brightening Eye Cream', 'kem-dng-chng-thm-qung-mt-c-hi-skinfood-salmon-brightening-eye-cream', 'Xuất xứ : Skinfood - Korea.\r\nĐây là sản phẩm kem dưỡng sâu chống quầng thâm mắt chiết xuất từ cá hồi giúp cung cấp độ ẩm cần thiết cho vùng da mắt, làm mất dần quầng thâm mắt, giúp bạn có một khuôn mặt trang điểm rạng rỡ và đẹp hơn.', '<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Trọng Lượng: 30ml</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;"><strong><a title="Kem Dưỡng Chống Th&acirc;m Quầng Mắt C&aacute; Hồi Skinfood" href="/shop/Duong-Mat---Eye-Cream/Kem-Duong-Chong-Tham-Quang-Mat-Ca-Hoi-Skinfood---Salmon-Brightening-Eye-Cream">Kem Dưỡng Chống Th&acirc;m Quầng Mắt C&aacute; Hồi Skinfood</a></strong> - Salmon Brightening Eye Cream&nbsp;tập trung th&uacute;c đẩy v&agrave; cung cấp omega-3 fatty acid, haloxyl, arbutin v&agrave; vitamins gi&uacute;p m&aacute;u lưu th&ocirc;ng hiệu quả v&agrave; l&agrave;m trắng cho l&agrave;n da v&ugrave;ng mắt s&aacute;ng rạng rỡ đỡ mệt mỏi hơn.</span><br /><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;"><strong><a title="Kem Dưỡng Chống Th&acirc;m Quầng Mắt C&aacute; Hồi Skinfood" href="/shop/Duong-Mat---Eye-Cream/Kem-Duong-Chong-Tham-Quang-Mat-Ca-Hoi-Skinfood---Salmon-Brightening-Eye-Cream">Kem Dưỡng Chống Th&acirc;m Quầng Mắt C&aacute; Hồi Skinfood</a></strong><span>&nbsp;</span>&nbsp;được đ&aacute;nh gi&aacute; 5* v&agrave; l&agrave; d&ograve;ng sản phẩm h&agrave;ng đầu trong c&aacute;c <strong>mỹ phẩm trị quầng th&acirc;m mắt</strong> khi sử dụng trong v&ograve;ng 2 tuần nh&eacute;!</span><br /><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Hướng Dẫn Sử Dụng:</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Sau khi rửa sạch mặt, nếu c&oacute;, sử dụng toner ( nước hoa hồng ), sau đ&oacute;, lấy một lượng serum vừa đủ thoa l&ecirc;n v&ugrave;ng quanh mắt v&agrave; massage nhẹ nh&agrave;ng để tinh chất thẩm thấu v&agrave;o da một c&aacute;ch tốt nhất. D&ugrave;ng th&ecirc;m kem dưỡng ( c&ugrave;ng bộ ) nếu c&oacute; để đạt được hiệu quả tối ưu nhất ( Khi d&ugrave;ng v&agrave;o buổi tối )!</span></p>', '2014_02_25_12_59_45-shopmyphamhan-kem-duong-mat-ca-hoi.jpg', 420000, 370000, 'EYESF01', 1, '0', 0, 0, '0', '1', '1', 1393161078),
