---Eye-Cream/Serum-Duong-Chong-Tham-Quang-Mat-Ca-Hoi-Skinfood--Salmon-Brightening-"><strong>h&agrave;ng đầu trong c&aacute;c mỹ phẩm trị quầng th&acirc;m mắt</strong></a> khi sử dụng trong v&ograve;ng 2 tuần nh&eacute;!</span><br /><br /><span style="font-size: small;"><span style="font-size: small;">Hướng Dẫn Sử Dụng:</span></span><br /><br /><span style="font-size: small;">Sau khi rửa sạch mặt, nếu c&oacute;, sử dụng toner ( nước hoa hồng ), sau đ&oacute;, lấy một lượng serum vừa đủ thoa l&ecirc;n v&ugrave;ng quanh mắt v&agrave; massage nhẹ nh&agrave;ng để tinh chất thẩm thấu v&agrave;o da một c&aacute;ch tốt nhất. D&ugrave;ng th&ecirc;m kem dưỡng ( c&ugrave;ng bộ ) nếu c&oacute; để đạt được hiệu quả tối ưu nhất ( Khi d&ugrave;ng v&agrave;o buổi tối )!</span></p>', '2014_02_28_12_50_44-shopmyphamhan-Serum-Duong-Chong-Tham-Quang-Mat-Ca-Hoi-Skinfood-Salmon-Brightening.jpg', 420000, 370000, 'EYESF02', 1, '0', 0, 0, '0', '1', '1', 1393162018),
(52, 21, 'CC Cream', 'CC Cream Etude house 02 Glow có ánh nhũ', 'cc-cream-etude-house-02-glow-c-nh-nh', ' CC Cream có ánh nhũ ngọc trai mang lại độ căng, mượt và bóng khỏe cho làn da.', '<p><a title="CC Cream Etude house 02 Glow c&oacute; &aacute;nh nhũ" href="/shop/BB-Cream---CC-Cream/CC-Cream-Etude-house-02-Glow-co-anh-nhu"><strong><span style="font-size: small;">CC Cream Etude house 02 Glow c&oacute; &aacute;nh nhũ</span></strong></a></p>\r\n<p><span style="font-size: small;">Trọng lượng : 20g</span></p>\r\n<p><span style="font-size: small;">Đ&acirc;y<strong>&nbsp;</strong>l&agrave; d&ograve;ng kem trang điểm "th&ocirc;ng minh" - với khả năng tự điều chỉnh sắc m&agrave;u ph&ugrave; hợp với l&agrave;n da người sử dụng - khi mới lấy ra th&igrave; c&oacute; m&agrave;u trắng đục, ngay sau khi thoa l&ecirc;n da th&igrave; ngay lập tức CC Cream sẽ điều chỉnh v&agrave; đổi m&agrave;u sao cho kem l&ecirc;n m&agrave;u ph&ugrave; hợp với da bạn! H&atilde;y sở hữu ngay&nbsp;<a title="CC Cream Etude house 02 Glow" href="/shop/BB-Cream---CC-Cream/CC-Cream-Etude-house-02-Glow-co-anh-nhu"><strong>CC Cream Etude house 02 Glow</strong></a>&nbsp;để c&oacute; l&agrave;n da mịn m&agrave;ng, kh&ocirc; tho&aacute;ng v&agrave; tự nhi&ecirc;n.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;"><img title="CC Cream Etude house 02 Glow c&oacute; &aacute;nh nhũ 1" src="/uploads/img_product_detail/CCCreamEtudehouse01Silky-khong-anh-nhu0.jpg" alt="CC Cream Etude house 02 Glow c&oacute; &aacute;nh nhũ 1" width="485" height="480" /></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2014_02_25_15_29_45-shopmyphamhan-CCCreamEtudehous 02Glow-co-anh-nhu.jpg', NULL, 300000, 'CCET02', 1, '0', 0, 0, '0', '1', '1', 1393301006),
(53, 21, 'CC Cream', 'CC Cream Etude house 01 Silky không ánh nhũ', 'cc-cream-etude-house-01-silky-khng-nh-nh', 'CC Cream Etude house - Correct & Care CC Cream 01 Silky mang lại độ mịn cho làn da, không ánh nhũ.', '<p><a title="CC Cream Etude house 01 Silky kh&ocirc;ng &aacute;nh nhũ" href="/shop/BB-Cream---CC-Cream/CC-Cream-Etude-house-01-Silky-khong-anh-nhu"><strong><span style="font-size: small;">CC Cream Etude house 01 Silky kh&ocirc;ng &aacute;nh nhũ</span></strong></a></p>\r\n<p><span style="font-size: small;">Trọng lượng : 20g</span></p>\r\n<p><span style="font-size: small;">Đ&acirc;y l&agrave; d&ograve;ng kem trang điểm "th&ocirc;ng minh" - với khả năng tự điều chỉnh sắc m&agrave;u ph&ugrave; hợp với l&agrave;n da người sử dụng - khi mới lấy ra th&igrave; c&oacute; m&agrave;u trắng đục, ngay sau khi thoa l&ecirc;n da th&igrave; ngay lập tức CC Cream sẽ điều chỉnh v&agrave; đổi m&agrave;u sao cho kem l&ecirc;n m&agrave;u ph&ugrave; hợp với da bạn! H&atilde;y sở hữu ngay <a title="CC Cream Etude house 01 Silky" href="/shop/BB-Cream---CC-Cream/CC-Cream-Etude-house-01-Silky-khong-anh-nhu"><strong>CC Cream Etude house&nbsp;01 Silky&nbsp;</strong></a>để c&oacute; l&agrave;n da mịn m&agrave;ng, kh&ocirc; tho&aacute;ng v&agrave; tự nhi&ecirc;n.</span></p>\r\n<p><span style="font-size: small;"><img title="CC Cream Etude house 01 silky khong anh nhu 1" src="/uploads/img_product_detail/CCCreamEtudehouse01Silky-khong-anh-nhu0.jpg" alt="CC Cream Etude house 01 silky khong anh nhu 1" width="485" height="480" /></span></p>\r\n<p>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;</p>', '2014_02_25_14_58_42-shopmyphamhan-CCCreamEtudehouse01Silky-khong-anh-nhu.jpg', NULL, 300000, 'CCET01', 1, '0', 0, 0, '0', '1', '1', 1393301383),
(54, 59, 'Son Môi - Lipstick', 'Son Etude House Color Lips Fit', 'son-etude-house-color-lips-fit', 'Xuất xứ : Etude House - Korea.\r\n', '<p><a title="Son Etude House Color Lips Fit" href="/shop/Son-Moi---Son-Duong/Son-Etude-House-Color-Lips-Fit"><strong><span style="font-size: small;">Son Etude House Color Lips Fit</span></strong></a></p>\r\n<p><span style="font-size: small;">Trọng lượng : 10g</span></p>\r\n<p><span style="font-size: small;">D&ograve;ng son mới ra mắt ng&agrave;y 1 th&aacute;ng 2 năm 2014 n&agrave;y.M&agrave;u son độ b&oacute;ng v&agrave; mịn cao.<strong><span style="font-size: small;">&nbsp;<a title="Color Lips Fit" href="/shop/Son-Moi---Son-Duong/Son-Etude-House-Color-Lips-Fit">Color Lips Fit</a></span></strong> dạng lỏng nhưng m&agrave;u l&ecirc;n th&igrave; lại cảm gi&aacute;c rất đặc,m&ugrave;i thơm nhẹ nh&agrave;ng ,đặc biệt ko kh&ocirc; m&ocirc;i v&agrave; che phủ mọi khuyết điểm của m&ocirc;i , độ b&aacute;m d&iacute;nh tr&ecirc;n cả tuyệt vời.</span></p>\r\n<p><span style="font-size: small;"><img title="Son Etude House Color Lips Fit 1" src="/uploads/img_product_detail/SonEtudeHouseColorLipsFit-0.jpg" alt="Son Etude House Color Lips Fit 1" width="693" height="960" /></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2014_02_25_15_44_25-shopmyphamhan-SonEtudeHouseColorLipsFit.jpg', NULL, 190000, 'SONET1', 1, '0', 0, 0, '0', '1', '1', 1393317865),
(55, 61, 'Son Tint', 'Son Etude House Rosy Tint Lips', 'son-etude-house-rosy-tint-lips', 'Xuất xứ : Etude House - Korea.', '<p><a title="Son Etude House Rosy Tint Lips" href="/shop/Son-Moi---Son-Duong/Son-Etude-House-Rosy-Tint-Lips"><strong><span style="font-size: small;">Son Etude House Rosy Tint Lips</span></strong></a></p>\r\n<p><span style="font-size: small;">Trọng lượng tịnh: 9g</span></p>\r\n<p><span style="font-size: small;">- Son tint với thiết kế đầu m&uacute;t dạ dễ d&agrave;ng sử dụng.</span></p>\r\n<p><span style="font-size: small;">- Nằm trong thiết kế mới nhất <strong>"Rose Make-up Collection"</strong> 2013 của <a title="Son Etude House" href="/shop/Son-Moi---Son-Duong/Son-Etude-House-Rosy-Tint-Lips"><strong>Son Etude House</strong></a>.</span></p>\r\n<p><span style="font-size: small;">- <a title="Son dạng kem velvet Rosy" href="/shop/Son-Moi---Son-Duong/Son-Etude-House-Rosy-Tint-Lips"><strong>Son dạng kem velvet Rosy</strong></a>, được mệnh danh l&agrave; velvet tint.</span></p>\r\n<p><span style="font-size: small;">- Dạng son l&igrave; nhưng cung cấp nhiều dưỡng v&agrave; duy tr&igrave; độ ẩm tốt.</span><br /><br /></p>\r\n<p><span style="font-size: small;"><img title="Son Etude House Rosy Tint Lips 1" src="/uploads/img_product_detail/Son-Etude-House-Rosy-Tint-Lips.jpg" alt="Son Etude House Rosy Tint Lips 1" width="698" height="522" /></span></p>', '2014_02_25_16_00_37-shopmyphamhan-SonEtudeHouseRosyTintLips.jpg', NULL, 175000, 'SONET2', 1, '0', 0, 0, '0', '1', '1', 1393318672);
