(77, 9, 'Son Môi - TFS', 'Son Lesson03 Thefaceshop Creamy Matte PK102', 'son-lesson03-thefaceshop-creamy-matte-pk102', 'Xuất xứ : Thefaceshop - Korea.\r\nSon môi kết cấu dạng kem ẩm mượt với sắc màu sống động, với chiết xuất từ lựu và rau má giúp mang tới làn môi mịn màng quyến rũ. ', '<p><strong><span style="font-size: small;">Son Lesson03 Thefaceshop Creamy Matte PK102</span></strong></p>\r\n<p><span style="font-size: small;">Trọng lượng : 3,5g.</span></p>\r\n<p><span style="font-size: small;"><strong>Son m&ocirc;i Lesson <span style="font-size: small;">Creamy Matte</span></strong> kết cấu dạng kem ẩm mượt với sắc m&agrave;u sống động, với chiết xuất từ lựu v&agrave; rau m&aacute; gi&uacute;p mang tới l&agrave;n m&ocirc;i mịn m&agrave;ng quyến rũ. </span></p>\r\n<p><span style="text-decoration: underline; font-size: small;">Hướng Dẫn Sử Dụng :</span><br /><br /><span style="font-size: small;">D&ugrave;ng cọ hoặc thoa trực ti&ecirc;́p l&ecirc;n m&ocirc;i.</span></p>', '2014_02_27_14_42_42-shopmyphamhan-Son-Lesson03-Thefaceshop-Creamy-Matte-PK102.jpg', NULL, 200000, 'SONMTFS7', 1, '0', 0, 0, '0', '1', '1', 1393486962),
