(79, 15, 'Mặt Nạ - Tẩy Tế Bào Chết - TFS', 'Lột Mụn Volcanic Clay Black Head Charcoal Nose Strip', 'Lot-Mun-Volcanic-Clay-Black-Head-Charcoal-Nose-Strip', 'Xuất xứ : Thefaceshop - Korea.\r\nMặt nạ dành riêng cho vùng mũi giúp loại bỏ mụn đầu đen hoàn hảo. Bổ sung than hoạt tính giúp thanh lọc da.', '<p><a title="Lột Mụn Volcanic Clay Black Head Charcoal Nose Strip " href="/shop/Mat-Na---Tay-Te-Bao-Chet---TFS/Lot-Mun-Volcanic-Clay-Black-Head-Charcoal-Nose-Strip"><span style="font-size: small;"><strong>Lột Mụn Volcanic Clay Black Head Charcoal Nose Strip&nbsp;</strong></span></a></p>\r\n<p><span style="font-size: small;">Số lượng : 7 miếng</span></p>\r\n<p><span style="font-size: small;">Đ&acirc;y l&agrave; sản phẩm mặt nạ dạng <a title="miếng lột d&agrave;nh cho v&ugrave;ng mũi chiết xuất từ than hoạt t&iacute;nh v&agrave; tro n&uacute;i lửa" href="/shop/Mat-Na---Tay-Te-Bao-Chet---TFS/Lot-Mun-Volcanic-Clay-Black-Head-Charcoal-Nose-Strip"><strong>miếng lột d&agrave;nh cho v&ugrave;ng mũi chiết xuất từ than hoạt t&iacute;nh v&agrave; tro n&uacute;i lửa</strong></a> ở New Zealand - một trong những khu vực n&uacute;i lửa lớn nhất tr&ecirc;n thế giới.</span></p>\r\n<p><span style="font-size: small;"><strong><a title="Volcanic Clay Black Head Charcoal Thefaceshop" href="/shop/Mat-Na---Tay-Te-Bao-Chet---TFS/Lot-Mun-Volcanic-Clay-Black-Head-Charcoal-Nose-Strip">Volcanic Clay Black Head Charcoal Thefaceshop</a>&nbsp;</strong>c&oacute; t&aacute;c dụng l&agrave;m mềm da, <a title="se lỗ ch&acirc;n l&ocirc;ng" href="/shop/Mat-Na---Tay-Te-Bao-Chet---TFS/Lot-Mun-Volcanic-Clay-Black-Head-Charcoal-Nose-Strip"><strong>se lỗ ch&acirc;n l&ocirc;ng</strong></a> gi&uacute;p lỗ ch&acirc;n l&ocirc;ng th&ocirc;ng tho&aacute;ng v&agrave; sạch mụn đầu đen cho v&ugrave;ng mũi của bạn sẽ l&aacute;ng mịn hơn, kh&ocirc;ng c&ograve;n nỗi lo về dầu v&agrave; mụn.</span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">Hướng Dẫn Sử Dụng :</span></sp