(98, 45, 'Sữa Rửa Mặt - TFS', 'Sữa rửa mặt trắng da White Tree Snow Exfoliating Foam Cleanser', 'sa-ra-mt-trng-da-white-tree-snow-exfoliating-foam-cleanser', 'Xuất xứ : Thefaceshop - Korea.\r\nSữa rửa mặt White Tree Snow làm sạch tế bào chết và làm trắng da.', '<p><strong><span style="font-size: small;">Sữa rửa mặt trắng da White Tree Snow Exfoliating Foam Cleanser</span></strong></p>\r\n<p><span style="font-size: small;">Dung t&iacute;ch : 140ml.</span></p>\r\n<p><span style="font-size: small;"><span><strong>White Tree Snow</strong>&nbsp;</span>chiết xuất từ c&aacute;c th&agrave;nh phần:</span></p>\r\n<p><span style="font-size: small;">- C&acirc;y Vitamin chứa: Vitamin C (Gấp 200 lần lượng vitamin C trong 1 tr&aacute;i t&aacute;o). Gi&uacute;p da phục hồi t&iacute;nh đ&agrave;n hồi, loại bỏ tế b&agrave;o chết nhẹ nh&agrave;ng, ph&ograve;ng ngừa nếp nhăn xuất hiện. Ngăn ngừa v&agrave; loại trừ vết th&acirc;m đen, loại trừ c&aacute;c sắc tố ra ngo&agrave;i cơ thể, mang lại l&agrave;n da sang mịn v&agrave; khỏe mạnh; 18 ax&iacute;t amin thiết yếu, axit tr&aacute;i c&acirc;y gi&uacute;p điều ho&agrave; lại v&ograve;ng tuần ho&agrave;n</span></p>\r\n<p><span style="font-size: small;">- Flavonoid gi&uacute;p chống lại qu&aacute; tr&igrave;nh oxy ho&aacute;.</span></p>\r\n<p><span style="font-size: small;">- Arbutin: Chiết xuất từ c&acirc;y dương mai, l&agrave; th&agrave;nh phần l&agrave;m trắng da nổi tiếng.</span></p>\r\n<p><span style="font-size: small;">Sữa rửa mặt có hạt giúp <strong>l&agrave;m sạch tế b&agrave;o chết</strong> nhẹ nhàng v&agrave; <strong>l&agrave;m trắng s&aacute;ng da.</strong></span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">C&aacute;ch sử dụng :</span></span></p>\r\n<p><span style="font-size: small;">Sử dụng sau tẩy trang. Tạo bọt sản phẩm, massage khoảng 30 gi&acirc;y đến 1 ph&uacute;t v&agrave; rửa sạch lại với nước.</span></p>', '2014_02_28_13_57_41-shopmyphamhan-Sua-rua-mat-Trang-da-white-tree-sno