(110, 46, 'Tẩy Trang - TFS', 'Kem Tẩy Trang Lựu Thefaceshop Pomegranate Cleansing Cream', 'kem-ty-trang-lu-thefaceshop-pomegranate-cleansing-cream', 'Xuất xứ : Thefaceshop - Korea.\r\nKem Tẩy Trang Lựu thích hợp cho da khô.', '<p><strong><span style="font-size: small;">Kem Tẩy Trang Lựu Thefaceshop Pomegranate Cleansing Cream</span></strong></p>\r\n<p><span style="font-size: small;">Dung t&iacute;ch : 150ml.</span></p>\r\n<p><span id="fbPhotoSnowliftCaption" class="fbPhotosPhotoCaption" style="font-size: small;"><span class="hasCaption"><strong>Kem t&acirc;̉y trang với chi&ecirc;́t xu&acirc;́t từ lựu</strong> và b&ocirc;̣t lựu giúp làm sạch nhẹ nhàng lớp trang điểm cùng khả năng cung c&acirc;́p &acirc;̉m hi&ecirc;̣u quả cho da kh&ocirc;, đồng thời phục h&ocirc;̀i đ&ocirc;̣ đàn h&ocirc;̀i cho làn da.<br /> </span></span></p>\r\n<p><span id="fbPhotoSnowliftCaption" class="fbPhotosPhotoCaption" style="font-size: small;"><span class="hasCaption"><span style="text-decoration: underline;">Hướng dẫn sử dụng:</span><br /> </span></span></p>\r\n<p><span id="fbPhotoSnowliftCaption" class="fbPhotosPhotoCaption" style="font-size: small;"><span class="hasCaption">L&acirc;́y lượng vừa đủ, massage nhẹ nhàng từ 30 gi&acirc;y đ&ecirc;́n 1 phút. Dùng khăn gi&acirc;́y lau sạch sản ph&acirc;̉m và ti&ecirc;́p tục với sữa rửa mặt.</span></span></p>', '2014_03_02_21_28_09-shopmyphamhan-Kem-tay-trang-luu-Thefaceshop-Pomegranate-Cleansing-Cream.jpg', 170000, 150000, 'TTTFS1', 1, '0', 0, 0, '0', '1', '1', 1393751790),
(111, 46, 'Tẩy Trang - TFS', 'Kem Tẩy Trang Đường Đen Thefaceshop Black Sugar Cleansing Cream', 'kem-ty-trang-ng-en-thefaceshop-black-sugar-cleansing-cream', 'Xuất xứ : Thefaceshop - Korea.\r\nKem Tẩy Trang Đường Đen thích hợp cho da dầu.', '<p><strong><span style="font-size: small;">Kem Tẩy Trang Đường Đen Thefaceshop Black Sugar Cleansing Cream</span></strong></p>\r\n<p><span style="font-size: small;">Dung t&iacute;ch : 150ml.</span></p>\r\n<p><span style="font-size: small;"><strong>Kem t&acirc;̉y trang với chi&ecirc;́t xu&acirc;́t từ đường đen</strong>, tinh b&ocirc;̣t ng&ocirc; giúp làm sạch hi&ecirc;̣u quả các lớp trang đi&ecirc;̉m, làm sạch s&acirc;u l&ocirc;̃ ch&acirc;n l&ocirc;ng, loại bỏ b&atilde; nhờn, ngăn ngừa mụn đ&acirc;̀u đen hi&ecirc;̣u quả.<br /></span></p>\r\n<p><span style="font-size: small;"><span style="text-decoration: underline;">C&aacute;ch sử dụng:</span><br /></span></p>\r\n<p><span style="font-size: small;">L&acirc;́y lượng vừa đủ, massage nhẹ nhàng từ 30 gi&acirc;y đ&ecirc;́n 1 phút. Dùng khăn gi&acirc;́y lau sạch sản ph&acirc;̉m và ti&ecirc;́p tục với sữa rửa mặt.</span></p>', '2014_03_02_21_25_26-shopmyphamhan-Kem-tay-trang-duong-den- Thefaceshop-Black-Sugar-Cleansing-Cream.jpg', 170000, 150000, 'TTTFS2', 1, '0', 0, 0, '0', '1', '1', 1393752111),
(112, 46, 'Tẩy Trang - TFS', 'Sữa Tẩy Trang Gạo Thefaceshop Rice Water Bright Cleansing Milk', 'sa-ty-trang-go-thefaceshop-rice-water-bright-cleansing-milk', 'Xuất xứ : Thefaceshop - Korea. \r\nSữa Tẩy Trang Gạo tác dụng làm sáng da.\r\n', '<p><strong><span style="font-size: small;">Sữa Tẩy Trang Gạo Thefaceshop Rice Water Bright Cleansing Milk</span></strong></p>\r\n<p><span style="font-size: small;">Dung t&iacute;ch 250ml</span><br /><br /><span style="font-size: small;"><strong>Sữa tẩy trang Gạo</strong> chứa một sự pha trộn của nước gạo v&agrave; tr&iacute;ch xuất apricot Nhật Bản nhẹ nh&agrave;ng nhưng <strong>hiệu quả l&agrave;m tr&oacute;c c&aacute;c tế b&agrave;o da chết, <span style="font-size: small;">lớp trang điểm</span>, gi&uacute;p l&agrave;m sạch v&agrave; s&aacute;ng da, đem lại làn da &acirc;̉m mịn sau khi sử dụng.</strong></span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">C&aacute;ch sử dụng:</span></span></p>\r\n<p><span style="font-size: small;">Cho một lượng vừa đủ ra b&ocirc;ng cotton v&agrave; lau nhẹ.</span></p>', '2014_03_02_21_23_10-shopmyphamhan-Sua-tay-trang-gao-thefaceshop-Rice-Water-Bright-Cleansing-Milk.jpg', 190000, 175000, 'TTTFS3', 1, '0', 0, 0, '0', '1', '1', 1393754109),
