(127, 72, 'Costar', 'Nhau thai cừu úc Costar Placentra Essence of baby sheep 3000Mg (100 viên)', 'nhau-thai-cu-c-costar-placentra-essence-of-baby-sheep-3000mg-100-vin', 'Xuất xứ : Costar - Australia.\r\nViên nhau thai cừu úc giúp làn da trắng sáng, xóa bỏ các vết thâm nám, các vết tàn nhang, làm da căng chống chảy sệ bụng, ngực sau khi sinh.', '<p><a title="Nhau thai cừu &uacute;c Costar Placentra Essence of baby sheep 3000Mg (100 vi&ecirc;n)" href="/shop/Nhau-Thai-Cuu/Nhau-thai-cuu-uc-Costar-Placentra-Essence-of-baby-sheep-3000Mg--100-vien-"><span style="font-size: small;"><strong>Nhau thai cừu &uacute;c Costar <span style="font-size: small;">Placentra Essence of baby sheep</span>&nbsp;3000Mg (100 vi&ecirc;n)</strong></span></a></p>\r\n<p><span style="font-size: small;">Vi&ecirc;n nhau thai cừu Costar Placentra 3000 mg được sản xuất tại &Uacute;c, mỗi vi&ecirc;n nhau thai cừu <a title="chứa 3000mg chiết xuất từ nhau thai cừu" href="/shop/Nhau-Thai-Cuu/Nhau-thai-cuu-uc-Costar-Placentra-Essence-of-baby-sheep-3000Mg--100-vien-"><strong>chứa 3000mg chiết xuất từ nhau thai cừu</strong></a> tươi qua qu&aacute; tr&igrave;nh l&agrave;m lạnh kh&ocirc; ti&ecirc;n tiến gi&uacute;p giữ lại to&agrave;n bộ th&agrave;nh phần dinh dưỡng c&oacute; trong nhau thau cừu. <a title="Gi&uacute;p l&agrave;n da trắng s&aacute;ng, x&oacute;a bỏ c&aacute;c vết th&acirc;m n&aacute;m, c&aacute;c vết t&agrave;n nhang, l&agrave;m da căng chống chảy sệ bụng, ngực." href="/shop/Nhau-Thai-Cuu/Nhau-thai-cuu-uc-Costar-Placentra-Essence-of-baby-sheep-3000Mg--100-vien-"><strong>Gi&uacute;p l&agrave;n da trắng s&aacute;ng, x&oacute;a bỏ c&aacute;c vết th&acirc;m n&aacute;m, c&aacute;c vết t&agrave;n nhang, l&agrave;m da căng chống chảy sệ bụng, ngực.</strong></a><br /></span></p>\r\n<p><span style="font-size: small;">Th&agrave;nh Phần dinh dưỡng c&oacute; trong mỗi 100g<br /></span></p>\r\n<p><span style="font-size: small;">Protein ..................................................24,5g<br />Carbonhydrate......................................13,9g<br />Năng lượng ....................................2.432 KJ<br />Natri ..................................................1059mg<br />Chất b&eacute;o b&atilde;o h&ograve;a .............................14,28g<br />Chất b&eacute;o tổng cộng ..........................46,56g<br />Placentra Essence of baby sheep (3000) (Nhau Thai Cừu)<br /><br />C&ocirc;ng dụng Vi&ecirc;n Uống Nhau Thai Cừu &Uacute;c Costar Sheep Placentra:<br /></span></p>\r\n<ul>\r\n<li><span style="font-size: small;"><a title="Vi&ecirc;n uống từ nhau thai cừu vip placentra tăng cường hệ miễn dịch" href="/shop/Nhau-Thai-Cuu/Nhau-thai-cuu-uc-Costar-Placentra-Essence-of-baby-sheep-3000Mg--100-vien-"><strong>Vi&ecirc;n uống từ nhau thai cừu vip placentra tăng cường hệ miễn dịch</strong></a>, cải thiện sức sống v&agrave; sinh lực cho cơ thể.</span></li>\r\n<li><span style="font-size: small;">Đem lại sức sống mới cho l&agrave;n da.</span></li>\r\n<li><span style="font-size: small;">L&agrave;m tăng độ b&oacute;ng, s&aacute;ng cho l&agrave;n da, tăng t&iacute;nh đ&agrave;n hồi cho l&agrave;n da.</span></li>\r\n<li><span style="font-size: small;">L&agrave;m mờ vết t&agrave;n nhang, vết n&aacute;m, vết th&acirc;m.</span></li>\r\n<li><span style="font-size: small;">Giữ ẩm cho da, l&agrave;m mờ c&aacute;c vết nhăn.</span></li>\r\n<li><span style="font-size: small;">L&agrave;m tăng sản xuất tế b&agrave;o mới v&agrave; giảm sự xuất hiện sẹo.</span></li>\r\n<li><span style="font-size: small;">Điều ho&agrave; sự b&agrave;i tiết chất nhờn v&agrave; l&agrave;m se kh&iacute;t lỗ ch&acirc;n l&ocirc;ng.</span></li>\r\n<li><span style="font-size: small;">Giảm sệ ngực sau khi sinh.</span></li>\r\n</ul>\r\n<p><span style="font-size: small;"><span style="text-decoration: underline;"><span style="font-size: small;">Hướng Dẫn Sử Dụng:</span></span><br /></span></p>\r\n<p><span style="font-size: small;">Uống từ 2 vi&ecirc;n/ng&agrave;y trước khi ngủ 30 ph&uacute;t để hấp thu dưỡng chất tốt nhất.<br /></span></p>\r\n<p><span style="font-size: small;">Khuy&ecirc;n d&ugrave;ng cho phụ nữ sau 20 tuổi v&agrave; d&ugrave;ng li&ecirc;n tục một lần từ 2 - 3 th&aacute;ng.<br /></span></p>\r\n<p><span style="font-size: small;">Bảo quản: Nơi kh&ocirc; r&aacute;o, tho&aacute;ng m&aacute;t nhiệt độ dưới 30.</span></p>', '2014_03_06_23_18_28-shopmyphamhan-Nhau-thai-cuu-uc-Costar-Placentra-Essence-of-baby-sheep-3000Mg--100-vien-.jpg', 700000, 650000, 'NTC5', 1, '0', 0, 0, '0', '1', '1', 1393860110),
