(136, 69, 'Tinh Chất Dưỡng - Serum', 'Tinh chất đặc trị làm sáng da chiết xuất cà chua Skinfood Tomato Whitening Spot Serum', 'tinh-cht-c-tr-lm-sng-da-chit-xut-c-chua-skinfood-tomato-whitening-spot-serum', 'Xuất xứ : Skinfood - Korea.\r\nTinh chất đặc trị làm mờ vết thâm, tàn nhang và cải thiện màu sắc da.', '<p><span style="font-size: small;"><strong><a title="Tinh chất đặc trị l&agrave;m s&aacute;ng da chiết xuất c&agrave; chua Skinfood Tomato Whitening Spot Serum" href="/shop/Tinh-Chat-Duong---Serum/Tinh-chat-dac-tri-lam-sang-da-chiet-xuat-ca-chua-Skinfood-Tomato-Whitening-Spot-Serum">Tinh chất đặc trị l&agrave;m s&aacute;ng da chiết xuất c&agrave; chua Skinfood Tomato Whitening Spot Serum</a></strong></span></p>\r\n<p><span style="font-size: small;">Dung t&iacute;ch: 30ml</span></p>\r\n<p><span style="font-size: small;"><strong><a title="Tinh chất c&agrave; chua đặc trị l&agrave;m mờ vết th&acirc;m, t&agrave;n nhang v&agrave; cải thiện m&agrave;u sắc da." href="/shop/Tinh-Chat-Duong---Serum/Tinh-chat-dac-tri-lam-sang-da-chiet-xuat-ca-chua-Skinfood-Tomato-Whitening-Spot-Serum">Tinh chất c&agrave; chua đặc trị l&agrave;m mờ vết th&acirc;m, t&agrave;n nhang v&agrave; cải thiện m&agrave;u sắc da.</a></strong></span></p>\r\n<p><span style="font-size: small;"><a title="Tomato Whitening Spot Serum" href="/shop/Tinh-Chat-Duong---Serum/Tinh-chat-dac-tri-lam-sang-da-chiet-xuat-ca-chua-Skinfood-Tomato-Whitening-Spot-Serum"><strong>Tomato Whitening Spot Serum</strong></a>&nbsp;l&agrave; sản phẩm huyết thanh chiết xuất từ Arbutin, lựu, v&agrave; c&agrave; chua gi&agrave;u lycopene, vitamin v&agrave; kho&aacute;ng chất gi&uacute;p <strong><a title="điều trị vết th&acirc;m, n&aacute;m, những v&ugrave;ng da tối rất hiệu quả." href="/shop/Tinh-Chat-Duong---Serum/Tinh-chat-dac-tri-lam-sang-da-chiet-xuat-ca-chua-Skinfood-Tomato-Whitening-Spot-Serum">điều trị vết th&acirc;m, n&aacute;m, những v&ugrave;ng da tối rất hiệu quả.</a></strong></span></p>\r\n<p><span style="font-size: sma