(148, 48, 'Che Khuyết Điểm - Concealer', 'Che Khuyết Điểm Berry Lovely Girl TonyMoly 02', 'che-khuyt-im-berry-lovely-girl-tonymoly-02', 'Xuất xứ : Tony Moly - Korea.\r\nChe khuyết điểm dạng lỏng màu 02 tự nhiên.', '<p><span style="font-size: small;"><strong>Che Khuyết Điểm Berry Lovely Girl TonyMoly 02</strong></span><br /><br /><span style="font-size: small;">Dung t&iacute;ch : 3,5ml.</span><br /><br /><span style="font-size: small;">Th&agrave;nh phần v&agrave; c&ocirc;ng dụng:</span><br /><br /><span style="font-size: small;">Che khuyết điểm dạng lỏng TonyMoly với hiệu quả che cao gi&uacute;p che đi c&aacute;c vết th&acirc;m quanh v&ugrave;ng mắt v&agrave; c&aacute;c khuyết điểm tr&ecirc;n mặt. Đồng thời hiệu quả che đi c&aacute;c khuyết điểm ở m&ocirc;i gi&uacute;p cho m&ocirc;i dễ l&ecirc;n m&agrave;u hơn.</span><br /><br /><span style="font-size: small;">Hướng Dẫn Sử Dụng:</span><br /><span style="font-size: small;">Lấy 1 lượng vừa đủ thoa đều l&ecirc;n những vị tr&iacute; c&oacute; khuyết điểm (như vết n&aacute;m, t&agrave;n nhang, mụn&hellip;)</span></p>', '2014_03_06_22_59_42-shopmyphamhan-Che-khuyet-diem-Berry-Lovely-Girl-Tonymoly-02.jpg', NULL, 120000, 'CKDTM2', 1, '0', 0, 0, '0', '1', '1', 1394121582),
(149, 61, 'Son Tint', 'Son Tint Skinfood Jungle Fruits Vivid Tint Juice 02', 'son-tint-skinfood-jungle-fruits-vivid-tint-juice-02', 'Xuất xứ : Skinfood - Korea.\r\n', '<p><a title="Son Tint Skinfood Jungle Fruits Vivid Tint Juice 02" href="/shop/Son-Moi-/son-tint-skinfood-jungle-fruits-vivid-tint-juice-02"><strong><span style="font-size: small;">Son Tint Skinfood Jungle Fruits Vivid Tint Juice 02</span></strong></a></p>\r\n<p><span style="font-size: small;">D&ograve;ng son nằm trong bộ sưu tập mới nhất của Skinfood: Jungle Fruits.&nbsp;<a title="Son Vivid Multi Tint l&agrave; son dạng nước, d&agrave;nh cho cả m&ocirc;i, m&aacute; v&agrave; mắt." href="/shop/Son-Moi-/son-tint-skinfood-jungle-fruits-vivid-tint-juice-02"><strong>Son Vivid Multi Tint l&agrave; son dạng nước, d&agrave;nh cho cả m&ocirc;i, m&aacute; v&agrave; mắt</strong>.</a></span></p>\r\n<p><span style="font-size: small;">Hướng dẫn sử dụng:</span></p>\r\n<p><span style="font-size: small;">Sử dụng cho m&ocirc;i : giống như son tint , thoa trong l&ograve;ng m&ocirc;i hoặc theo &yacute; th&iacute;ch để c&oacute; 1 bờ m&ocirc;i căng mọng tr&agrave;n đầy sức sống.</span></p>\r\n<p><span style="font-size: small;">Sử dụng cho m&aacute;: trước khi thoa l&ecirc;n m&aacute;, cười mỉm để x&aacute;c định g&ograve; m&aacute;, sau đ&oacute; t&aacute;n nhẹ son theo hướng từ g&ograve; m&aacute; l&ecirc;n tr&ecirc;n tai.</span></p>\r\n<p><span style="font-size: small;">Sử dụng cho mắt : d&ugrave;ng chổi phết nhẹ son, t&aacute;n đều từ bầu mắt đến đu&ocirc;i mắt.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: small;"><img title="Son Tint Skinfood Jungle Fruits Vivid Tint Juice  1" src="/uploads/img_product_detail/Son-tint-skinfood-jungle-fruits-vivid-multi-juice0.jpg" alt="Son Tint Skinfood Jungle Fruits Vivid Tint Juice  1" width="500" height="366" /></span></p>\r\n<p>&nbsp;</p>', '2014_03_07_17_21_52-shopmyphamhan-Son-tint-skinfood-jungle-fruits-vivid-multi-juice.jpg', NULL, 195000, 'SMSF4', 1, '1', 20, 0, '0', '1', '1', 1394187171),
(150, 60, 'Son Dưỡng - Lip care', 'Son 3 trong 1 Etude House Sweet Recipe Cupcake All Over Color RD301', 'son-3-trong-1-etude-house-sweet-recipe-cupcake-all-over-color-rd301', 'Xuất xứ : Etude House - Korea.\r\nSản phẩm 3 trong 1: vừa là son môi, vừa là má hồng, vừa là màu mắt.', '<p><strong><span style="font-size: small;">Son 3 trong 1 Etude House Sweet Recipe Cupcake All Over Color RD301</span></strong></p>\r\n<p><span style="font-size: small;">Trọng Lượng: 10g</span></p>\r\n<p><span style="font-size: small;"><strong>Sweet Recipe l&agrave; bộ sưu tập mới ra mắt của Etude House</strong>, c&aacute;c sản phẩm trang điểm được thiết kế cực k&igrave; ngọt ng&agrave;o, đ&aacute;ng y&ecirc;u với h&igrave;nh d&aacute;ng của c&aacute;c loại b&aacute;nh, chocolate, kẹo...m&agrave;u sắc tươi tắn, m&ugrave;i hương cực k&igrave; hấp dẫn!</span><br /><br /><span style="font-size: small;">Sweet Recipe Cupcake All Over Color l&agrave; <strong>sản phẩm 3 trong 1: vừa l&agrave; son m&ocirc;i, vừa l&agrave; m&aacute; hồng, vừa l&agrave; m&agrave;u mắt</strong> với độ b&aacute;m tốt, mềm mịn, l&ecirc;n chuẩn m&agrave;u. Mỗi một sản phẩm l&agrave; một m&ugrave;i hương ngọt ng&agrave;o kh&aacute;c nhau, tha hồ lựa chon tone m&agrave;u y&ecirc;u th&iacute;ch bạn nh&eacute;!</span></p>', '2014_03_09_17_03_15-shopmyphamhan-son-3-trong-1-etude-house-sweet-recipe-cupcake-all-over-color-rd301.jpg', NULL, 150000, 'SONET6', 1, '0', 0, 0, '0', '1', '1', 1394188893),
(151, 60, 'Son Dưỡng - Lip care', 'Son 3 trong 1 Etude House Sweet Recipe Cupcake All Over Color OR201', 'son-3-trong-1-etude-house-sweet-recipe-cupcake-all-over-color-or201', 'Xuất xứ : Etude House - Korea.\r\nSản phẩm 3 trong 1: vừa là son môi, vừa là má hồng, vừa là màu mắt.', '<p><strong><span style="font-size: small;">Son 3 trong 1 Etude House Sweet Recipe Cupcake All Over Color OR201</span></strong></p>\r\n<p><span style="font-size: small;">Trọng Lượng: 10g</span></p>\r\n<p><span style="font-size: small;">Sweet Recipe l&agrave; bộ sưu tập mới ra mắt của Etude House, c&aacute;c sản phẩm trang điểm được thiết kế cực k&igrave; ngọt ng&agrave;o, đ&aacute;ng y&ecirc;u với h&igrave;nh d&aacute;ng của c&aacute;c loại b&aacute;nh, chocolate, kẹo...m&agrave;u sắc tươi tắn, m&ugrave;i hương cực k&igrave; hấp dẫn!</span></p>\r\n<p><span style="font-size: small;"><strong>Sweet Recipe Cupcake All Over Color l&agrave; sản phẩm 3 trong 1</strong>: <strong>vừa l&agrave; son m&ocirc;i, vừa l&agrave; m&aacute; hồng, vừa l&agrave; m&agrave;u mắt với độ b&aacute;m tốt</strong>, mềm mịn, l&ecirc;n chuẩn m&agrave;u. Mỗi một sản phẩm l&agrave; một m&ugrave;i hương ngọt ng&agrave;o kh&aacute;c nhau, tha hồ lựa chon tone m&agrave;u y&ecirc;u th&iacute;ch bạn nh&eacute;!</span></p>', '2014_03_09_17_05_39-shopmyphamhan-son-3-trong-1-etude-house-sweet-recipe-cupcake-all-over-color-or201.jpg', NULL, 150000, 'SONET7', 1, '0', 0, 0, '0', '1', '1', 1394189173),
(152, 74, 'Careline', 'Son Dưỡng Môi Nhau Thai Cừu Careline', 'son-d-ng-mi-nhau-thai-c-u-careline', 'Xuất xứ : Careline - Australia.', '<p><a title="Son dưỡng m&ocirc;i nhau thai cừu Careline " href="/shop/son-d-ng/son-d-ng-mi-nhau-thai-c-u-careline"><strong><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Son dưỡng m&ocirc;i nhau thai cừu Careline&nbsp;</span></strong></a></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;"><a title="Son dưỡng c&oacute; chi&ecirc;́t xuất từ nhau thai cừu" href="/shop/son-d-ng/son-d-ng-mi-nhau-thai-c-u-careline"><strong>Son dưỡng c&oacute; chi&ecirc;́t xuất từ nhau thai cừu</strong></a>- c&oacute; t&aacute;c dụng chống nứt nẻ v&agrave; l&agrave;m mềm m&ocirc;i.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Son <a title="dưỡng m&ocirc;i Careline" href="/shop/son-d-ng/son-d-ng-mi-nhau-thai-c-u-careline"><strong>dưỡng m&ocirc;i Careline</strong></a> gi&agrave;u chất l&agrave;m mềm, chống m&ocirc;i kh&ocirc; v&agrave; nẻ. Sử dụng thường xuy&ecirc;n l&agrave;m m&ocirc;i mềm mại. Chứa chất chống nắng để bảo vệ da.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Th&agrave;nh phần ch&iacute;nh :&nbsp;</span><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Vitamin E, chiết xuất mỡ cừu v&agrave; tinh dầu quả mơ gi&uacute;p dưỡng ẩm s&acirc;u cho m&ocirc;i.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">C&aacute;ch d&ugrave;ng INSERT INTO `shop_products` (`id`, `cate_id`, `cate_name`, `name`, `alias`, `info`, `description`, `image`, `price_curr`, `price`, `barcode`, `quantity`, `is_sale_off`, `discount`, `total_buy`, `is_popular`, `page`, `status`, `create_date`) VALUES
